define(function(){return function(a){describe("ParsleyUtils",function(){it("should have a proper deserializeValue() function",function(){expect(a.deserializeValue("true")).to.be(true);expect(a.deserializeValue("1")).to.be(1);expect(a.deserializeValue('["foo", "bar"]')).to.be.an("array");expect(a.deserializeValue('{"foo": "bar"}')).to.be.an("object")});it("should have a proper camelize() function",function(){expect(a.camelize("foo-bar")).to.be("fooBar");expect(a.camelize("foo-bar-baz")).to.be("fooBarBaz");expect(a.camelize("foo-bAr-baz")).to.be("fooBArBaz")});it("should have a proper dasherize() function",function(){expect(a.dasherize("fooBar")).to.be("foo-bar");expect(a.dasherize("fooBarBaz")).to.be("foo-bar-baz");expect(a.dasherize("fooBArBaz")).to.be("foo-b-ar-baz")});it("should have a proper attr() function",function(){var c=[{attributes:[{specified:true,name:"data-parsley-foo",value:"bar"},{specified:true,name:"parsley-foo",value:"baz"},{specified:true,name:"data-parsley-bar",value:"[0, 42]"},{specified:false,name:"data-parsley-foo",value:"bar"},{foo:"bar"}]}],b=a.attr(c,"data-parsley-");expect(b).to.eql({foo:"bar",bar:[0,42]});expect(a.attr(c,"data-parsley-","foo")).to.be(true);expect(a.attr(c,"data-parsley-","FoO")).to.be(true);expect(a.attr(c,"data-parsley-","baz")).to.be(false)});it("should have a checkAttr feature for attr() method",function(){var b=[{attributes:[{specified:true,name:"data-parsley-required-message",value:"foo"},{specified:true,name:"data-parsley-validate",value:true}]}];expect(a.attr(b,"data-parsley-","required")).to.be(false);expect(a.attr(b,"data-parsley-","required-message")).to.be(true);expect(a.attr(b,"data-parsley-","validate")).to.be(true)});it("should have a proper get() function",function(){var b={foo:{bar:"baz"},bar:"qux"};expect(a.get(b,"bar")).to.be("qux");expect(a.get(b,"foo.bar")).to.be("baz");expect(a.get(b,"foo.baz")).to.be(undefined)})})}});